function onceSubmit(btnObj){
    if(btnObj.hasClass("btn-disabled")){
        return false;
    }else {
        if (btnObj instanceof jQuery) {
            $(document).ajaxStart(function(){
                btnObj.addClass("btn-disabled");
            }).ajaxComplete(function(){
                btnObj.removeClass("btn-disabled");
            })
            return true;
        }else{
            return false;
        }
    }
}
